import Typography from '@material-ui/core/Typography'

function Copyright() {
    return (
      <Typography variant="body2" color="textSecondary" align="center">
        {'Copyright © '}

          RK Engineering Corporation{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }

const Footer = () => (
    <div className=" h-32">
        <Copyright/>
            </div>
)

export default Footer;
